   useEffect
  return (
    <div>
      <Header />
      <div className="container">
        <div className="row justify-content-md-center mt-4">
          <Todo />
          <Todo />
          <Todo />
          <Todo />
          <Todo />
          <Todo />
          <Todo />
        </div>
      </div>

      <div
        className=""
        style={{ position: 'fixed', right: 50, bottom: 50, zIndex: 1030 }}
      >
        <AddTodoModal />
      </div>
    </div>
  );
}

export default Home;
